   "source": [
    "In these rules:\n",
    "\n",
    "* Support indicates how often the rule applies to the entire dataset.\n",
    "* Confidence tells us how likely the item on the right-hand side (RHS) is bought when the items on the left-hand side (LHS) are bought.\n",
    "* Lift shows how much more often the items on the RHS are bought with the items on the LHS compared to being bought on their own.\n",
    "* Count is the number of transactions in which the rule has been found.\n",
    "\n",
    "This insight helps retailers understand product affinities, which can inform strategies for marketing, cross-selling, and store layout."
   ]
  },
