    "\n",
    "The plot is a network graph showing which grocery items are often bought together. The dots are different items, like sausage or whole milk. The size of each dot shows how often that item is bought, with bigger dots being more common. The lines between the dots show that when people buy one item, they often buy the other item too. The color of the dots gets darker for combinations bought together more often than you'd expect by chance, with darker red meaning a stronger connection. This helps stores understand what items to put on sale together or place closer to each other on shelves."
