    "The above image shows a parallel coordinates plot for visualizing 17 association rules from our market basket analysis: The plot is a visual way to show shopping patterns from the data. It has lines connecting what people buy together. For example, if someone buys sausage and yogurt, they often also buy whole milk. The lines start with the first things people buy and end with what they usually buy next. The plot helps us see which items are commonly bought in combination."
